import {AppBar, Toolbar} from '@mui/material';
const Header = () => {
    const logo = "https://get-staffed.com/wp-content/uploads/2020/07/indeed-logo.png";
    return (
        <AppBar>
            <Toolbar>
                <img src={logo} />

            </Toolbar>
        </AppBar>
    );
}
export default Header;
